import Card from './Card';
import styled from "styled-components"
import { Card_Data } from './Card_Data';

const Services_Page = () => {

  const [state, setState] = useState(Card_Data);
  console.log(state);
  return (
    <>
        <Wrapper>
        <div className="container">
          <div className="grid grid-three-column">
            {state.map((currentData) => {
              const { icon, title, para,icon1,title1,para1} = currentData;
              return (
                <>
                <div>
                <div className="card">
          <div className="card_icon">
            <div className="icon"> {icon}{icon1}</div>
          </div>
          <div className="card_title">
            <h3>{title}{title1}</h3>
            <p className="card_para">{para}{para1}</p>
          </div>
        </div>
                </div>
                </>
              );
            })}

          </div>
        </div>
      </Wrapper>
   </>
  );
}
const Wrapper = styled.section`
  padding: 1rem;
  text-align: center;
  .grid {
    display: grid;
    gap: 2rem;
    margin: 8rem 0rem;
  }
  .grid-three-column {
    grid-template-columns: repeat(3, 1fr);
  }
`;
export default Services_Page;
